ARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.","# See the License for the specific language governing permissions and","# limitations under the License.","# </@LICENSE>","package Mail::SpamAssassin::Plugin::ASCII;","use strict;","use warnings FATAL => 'all';","use v5.12;","use Encode;","use utf8;","","=encoding utf8","","=head1 NAME","","Mail::SpamAssassin::Plugin::ASCII - SpamAssassin plugin to convert non-ASCII characters to their ASCII equivalents","","=head1 SYNOPSIS","","  loadplugin Mail::SpamAssassin::Plugin::ASCII","","  ascii      RULE_NAME   /You have a new voice-?mail/i","  describe   RULE_NAME   Voice mail spam","  score      RULE_NAME   1.0","","=head1 DESCRIPTION","","This plugin attempts to convert non-ASCII characters to their ASCII equivalents","and then run rules against the converted text.  This is useful for","catching spam that uses non-ASCII characters to obfuscate words. For example,","","    Ýou hãve a nèw vòice-mãil","    PαyPal","    You havé Reꞓeìved an Enꞓryptéd Company Maíl","    ѡѡѡ.ЬіɡЬаɡ.ϲо.zа","","would be converted to","","    You have a new voice-mail","    PayPal","    You have ReCeived an EnCrypted Company Mail","    www.bigbag.co.za","","Unlike other transliteration software, this plugin converts non-ASCII characters","to their ASCII equivalents based on appearance instead of meaning. For example, the","German eszett character 'ß' is converted to the Roman letter 'B' instead of 'ss'","because it resembles a 'B' in appearance. Likewise, the Greek letter Sigma ('Σ') is","converted to 'E' and a lower case Omega ('ω') is converted to 'w' even though these","letters have different meanings than their originals.","","Not all non-ASCII characters are converted. For example, the Japanese Hiragana","character 'あ' is not converted because it does not resemble any ASCII character.","Characters that have no ASCII equivalent are removed from the text.","","The plugin also removes zero-width characters such as the zero-width","space (U+200B) and zero-width non-joiner (U+200C) that are often used to","obfuscate words.","","If you want to write rules that match against the original non-ASCII text,","you can still do so by using the standard C<body> and C<rawbody> rules. The","converted text is only used when evaluating rules that use the C<ascii> rule type.","","Note that obfuscation is still possible within the ASCII character set. For example,","the letter 'O' can be replaced with the number '0' and the letter 'l' can be replaced","with the number '1' as in \"PayPa1 0rder\". This plugin does not attempt to catch these","types of obfuscation. Therefore, you still need to use other techniques such as using","a character class or C<replace_tags> to catch these types of obfuscation.","","=head1 TFLAGS","","This plugin supports the following C<tflags>:","","=over 4","","=item nosubject","","By default the message Subject header is considered part of the body and becomes the first line","when running the rules. If you don't want to match Subject along with body text, use \"tflags RULENAME nosubject\"","","=item multiple","","The test will be evaluated multiple times, for use with meta rules.","","=item maxhits=N","","If multiple is specified, limit the number of hits found to N. If the rule is used in a meta rule that counts","the hits (e.g. __RULENAME > 5), this is a way to avoid wasted extra work (use \"tflags __RULENAME multiple maxhits=6\").","","=back","","=head1 AUTHORS","","Kent Oyer <kent@mxguardian.net>","","=head1 COPYRIGHT AND LICENSE","","Copyright (C) 2023 MXGuardian LLC","","This is free software; you can redistribute it and/or modify it under","the terms of the Apache License 2.0. See the LICENSE file included","with this distribution for more information.","","This plugin is distributed in the hope that it will be useful, but WITHOUT ANY WARRANTY; without even the","implied warranty of MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.","","=cut","","our $VERSION = 0.19;","","use Mail::SpamAssassin::Plugin;","use Mail::SpamAssassin::Logger qw(would_log);","use Mail::SpamAssassin::Util qw(compile_regexp &is_valid_utf_8 &untaint_var);","","our @ISA = qw(Mail::SpamAssassin::Plugin);","","my %char_map;","","# constructor","sub new {","    my $class = shift;","    my $mailsaobject = shift;","","    # some boilerplate...","    $class = ref($class) || $class;","    my $self = $class->SUPER::new($mailsaobject);","    bless ($self, $class);","","    $self->set_config($mailsaobject->{conf});","    $self->load_map();","","    return $self;","}","","sub dbg { Mail::SpamAssassin::Logger::dbg (\"ASCII: @_\"); }","sub info { Mail::SpamAssassin::Logger::info (\"ASCII: @_\"); }","","sub load_map {","    my ($self) = @_;","","    return if %char_map;","","    # build character map from __DATA__ section","    while (<DATA>) {","        chomp;","        my ($key,$value) = split /\\s+/;","        my $ascii = join('', map { chr(hex($_)) } split /\\+/, $value);","        $char_map{chr(hex($key))} = $ascii;","    }","    close DATA;","}","","","sub set_config {","    my ($self, $conf) = @_;","    my @cmds;","","    push (@cmds, (","        {","            setting => 'ascii',","            is_priv => 1,","            type => $Mail::SpamAssassin::Conf::CONF_TYPE_STRING,","            code => sub {","                my ($self, $key, $value, $line) = @_;","","                if ($value !~ /^(\\S+)\\s+(.+)$/) {","                    return $Mail::SpamAssassin::Conf::INVALID_VALUE;","                }","                my $name = $1;","                my $pattern = $2;","","                my ($re, $err) = compile_regexp($pattern, 1);","                if (!$re) {","                    dbg(\"Error parsing rule: invalid regexp '$pattern': $err\");","                    return $Mail::SpamAssassin::Conf::INVALID_VALUE;","                }","","                $conf->{parser}->{conf}->{ascii_rules}->{$name} = $re;","","                # just define the test so that scores and lint works","                $self->{parser}->add_test($name, undef,","                    $Mail::SpamAssassin::Conf::TYPE_EMPTY_TESTS);","","","            }","        }","    ));","","    $conf->{parser}->register_commands(\\@cmds);","}","","sub finish_parsing_end {","    my ($self, $opts) = @_;","    my $conf = $opts->{conf};","","    # prevent warnings about redefining subs","    undef &_run_ascii_rules;","","    # only compile rules if we have any","    return unless exists $conf->{ascii_rules};","","    # check if we should include calls to dbg()","    my $would_log = would_log('dbg');","","    # build eval string","    my $eval = <<'EOF';","package Mail::SpamAssassin::Plugin::ASCII;","","sub _run_ascii_rules {","    my ($self, $opts) = @_;","    my $pms = $opts->{permsgstatus};","    my ($test_qr,$hits,$nosubj);","","    # get ascii body","    my $ascii_body = $self->_get_ascii_body($pms);","","    # check all script rules","EOF","    my $loopid = 0;","    foreach my $name (keys %{$conf->{ascii_rules}}) {","        $loopid++;","        my $test_qr = $conf->{ascii_rules}->{$name};","        my $tflags = $conf->{tflags}->{$name} || '';","        my $score = $conf->{scores}->{$name} || 1;","","        my $dbg_running_rule = '';","        my $dbg_ran_rule = '';","        if ( $would_log ) {","            $dbg_running_rule = qq(dbg(\"running rule $name\"););","            $dbg_ran_rule = qq(dbg(qq(ran rule $name ======> got hit \"\\$match\")););","        }","","        my $ifwhile = 'if';","        my $last = 'last;';","        my $modifiers = 'p';","        my $init_hits = '';","","        if ( $tflags =~ /\\bmultiple\\b/ ) {","            $ifwhile = 'while';","            $modifiers .= 'g';","            if ($tflags =~ /\\bmaxhits=(\\d+)\\b/) {","                $init_hits = \"\\$hits = 0;\";","                $last = \"last rule_$loopid if ++\\$hits >= $1;\";","            } else {","                $last = '';","            }","        }","","        my $init_subject = '';","        my $skip_subject = '';","","        if ( $tflags =~ /\\bnosubject\\b/ ) {","            $init_subject = '$nosubj = 1;';","            $skip_subject = 'if ($nosubj) { $nosubj = 0; next; }';","        }","","        $eval .= <<\"EOF\";","    $dbg_running_rule","    \\$test_qr = \\$pms->{conf}->{ascii_rules}->{$name};","    $init_hits","    $init_subject","    rule_$loopid: foreach my \\$line (\\@\\$ascii_body) {","        $skip_subject","        $ifwhile ( \\$line =~ /\\$test_qr/$modifiers ) {","            my \\$match = defined \\${^MATCH} ? \\${^MATCH} : '<negative match>';","            $dbg_ran_rule","            \\$pms->{pattern_hits}->{$name} = \\$match;","            \\$pms->got_hit('$name','ASCII: ','ruletype' => 'body', 'score' => $score);","            $last","        }","    }","EOF","","    }","    $eval .= <<'EOF';","}","","EOF","","    # print \"$eval\\n\";","    # compile the new rules","    eval untaint_var($eval);","    if ($@) {","        die(\"ASCII: Error compiling rules: $@\");","    }","","}","","sub parsed_metadata {","    my ($self, $opts) = @_;","","    $self->_run_ascii_rules($opts) if $self->can('_run_ascii_rules');","","}","","#","# Get the body of the message as an array of lines","#","sub _get_ascii_body {","    my ($self, $pms) = @_;","","    if (exists $pms->{ascii_body}) {","        return $pms->{ascii_body};","    }","","    my @lines;","    foreach (@{ $pms->get_decoded_stripped_body_text_array() }) {","        my $line = is_valid_utf_8($_) ? decode('UTF-8', $_) : $_;","        # remove zero-width characters and combining marks","        $line =~ s/[\\xAD\\x{034F}\\x{200B}-\\x{200F}\\x{202A}\\x{202B}\\x{202C}\\x{2060}\\x{FEFF}]|\\p{Combining_Mark}//g;","        # replace non-ascii characters with ascii equivalents","        $line =~ s/([^[:ascii:]])/defined($char_map{$1})?$char_map{$1}:' '/eg;","        # collapse spaces","        $line =~ s/\\x{20}+/ /g;","        push @lines, $line;","    }","    $pms->{ascii_body} = \\@lines;","}","","1;","","__DATA__","00A0 20","00A9 28+43+29","00AA 61","00AE 28+52+29","00B2 32","00B3 33","00B4 27","00B5 75","00B7 2E","00B8 2C","00B9 31","00BA 6F","00BC 31+2F+34","00BD 31+2F+32","00BE 33+2F+34","00C0 41","00C1 41","00C2 41","00C3 41","00C4 41","00C5 41","00C6 41+45","00C7 43","00C8 45","00C9 45","00CA 45","00CB 45","00CC 49","00CD 49","00CE 49","00CF 49","00D0 44","00D1 4E","00D2 4F","00D3 4F","00D4 4F","00D5 4F","00D6 4F","00D7 78","00D8 4F","00D9 55","00DA 55","00DB 55","00DC 55","00DD 59","00DF 42","00E0 61","00E1 61","00E2 61","00E3 61","00E4 61","00E5 61","00E6 61+65","00E7 63","00E8 65","00E9 65","00EA 65","00EB 65","00EC 69","00ED 69","00EE 69","00EF 69","00F0 6F","00F1 6E","00F2 6F","00F3 6F","00F4 6F","00F5 6F","00F6 6F","00F8 6F","00F9 75","00FA 75","00FB 75","00FC 75","00FD 79","00FF 79","0100 41","0101 61","0102 41","0103 61","0104 41","0105 61","0106 43","0107 63","0108 43","0109 63","010A 43","010B 63","010C 43","010D 63","010E 44","010F 64","0110 44","0111 64","0112 45","0113 65","0114 45","0115 65","0116 45","0117 65","0118 45","0119 65","011A 45","011B 65","011C 47","011D 67","011E 47","011F 67","0120 47","0121 67","0122 47","0123 67","0124 48","0125 68","0126 48","0127 68","0128 49","0129 69","012A 49","012B 69","012C 49","012D 69","012E 49","012F 69","0130 49","0131 69","0132 49+4A","0133 69+6A","0134 4A","0135 6A","0136 4B","0137 6B","0138 6B","0139 4C","013A 6C","013B 4C","013C 6C","013D 4C","013E 6C","013F 4C","0140 6C","0141 4C","0142 6C","0143 4E","0144 6E","0145 4E","0146 6E","0147 4E","0148 6E","0149 6E","014A 4E","014B 6E","014C 4F","014D 6F","014E 4F","014F 6F","0150 4F","0151 6F","0152 4F+45","0153 6F+65","0154 52","0155 72","0156 52","0157 72","0158 52","0159 72","015A 53","015B 73","015C 53","015D 73","015E 53","015F 73","0160 53","0161 73","0162 54","0163 74","0164 54","0165 74","0166 54","0167 74","0168 55","0169 75","016A 55","016B 75","016C 55","016D 75","016E 55","016F 75","0170 55","0171